#include <iostream>
#include <stack>
using namespace std;
class Solution
{
public:
    string removeStars(string s)
    {
        if (s.find('*') == string::npos) return s;
        stack<char> st;
        for (const auto& c : s)
        {
            if (c == '*')
            {
                st.pop();
                continue;
            }
            st.push(c);
        }
        s.clear();
        while (!st.empty())
        {
            s = st.top() + s;
            st.pop();
        }
        return s;
    }
};

int main()
{
    Solution sol;
    string s = "leet**cod*e";
    cout << "leftover string: " << sol.removeStars(s) << endl;

    s = "erase*****";
    cout << "leftover string: " << sol.removeStars(s) << endl;

    // s = "";
    // cout << "leftover string: " << sol.removeStars(s) << endl;

    return 0;
}